import{_ as r,a as d,b as o}from"./chunks/kakuteh7mini_pinout.D7II2j90.js";import{_ as i,c as l,j as e,a as n,G as s,a8 as h,B as u,o as p}from"./chunks/framework.BDnHobkS.js";const y=JSON.parse('{"title":"Holybro Kakute H7 mini","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/kakuteh7mini.md","filePath":"ko/flight_controller/kakuteh7mini.md"}'),c={name:"ko/flight_controller/kakuteh7mini.md"};function m(b,t,f,g,k,S){const a=u("Badge");return p(),l("div",null,[t[0]||(t[0]=e("h1",{id:"holybro-kakute-h7-mini",tabindex:"-1"},[n("Holybro Kakute H7 mini "),e("a",{class:"header-anchor",href:"#holybro-kakute-h7-mini","aria-label":'Permalink to "Holybro Kakute H7 mini"'},"​")],-1)),s(a,{type:"tip",text:"PX4 v1.13"}),t[1]||(t[1]=h('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The <a href="https://holybro.com/collections/autopilot-flight-controllers/products/kakute-h7-mini" target="_blank" rel="noreferrer">Holybro Kakute H7 mini</a> flight controller is intended for lightweight frame builds (such as racers, etc.).</p><p>This flight controller is full of features including HD camera plug, dual plug-and-play 4in1 ESC ports, VTX ON/OFF Pit Switch (Battery Voltage), barometer, OSD, 6x UARTs, 128MB Flash for logging (not supported with PX4 yet), 5V BEC, and bigger soldering pad with easy layout and much more.</p><p>The Kakute H7 mini builds upon the best features of its predecessor, the <a href="./../flight_controller/kakutef7.html">Kakute F7</a>, and the <a href="./../flight_controller/kakuteh7.html">Kakute H7</a>. The board also has an on-board barometer, LED &amp; buzzer pad, and I2C pad (SDA &amp; SCL) for external GPS/magnetometers.</p><p><img src="'+r+'" width="300px" title="KakuteH7Mini Top Image"> <img src="'+d+'" width="300px" title="KakuteH7Mini Bottom Image"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>PX4 runs on the H7 mini v1.3 and later.</p></div><h2 id="주요-특징" tabindex="-1">주요 특징 <a class="header-anchor" href="#주요-특징" aria-label="Permalink to &quot;주요 특징&quot;">​</a></h2><ul><li>MCU: STM32H743 32-bit processor running at 480 MHz</li><li>IMU: BMI270</li><li>Barometer: BMP280</li><li>OSD: AT7456E</li><li>6x UARTs (1,2,3,4,6,7)</li><li>VTX On/Off Pit Switch: Not used with PX4</li><li>9x PWM Outputs (8 Motor Outputs, 1 LED)</li><li>2x JST-SH1.0_8pin port (For Single or 4in1 ESCs, x8/Octocopter plug &amp; play compatible)</li><li>1x JST-GH1.5_6pin port (For HD System like Caddx Vista &amp; Air Unit)</li><li>Battery input voltage: 2S-6S</li><li>BEC 5V 2A Cont.</li><li>Mounting: 20 x 20mm/Φ3.6mm hole with M3 &amp; M2 Grommets</li><li>Dimensions: 30x31x6mm</li><li>Weight: 5.5g</li></ul><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p>The board can be bought from one of the following shops (for example):</p><ul><li><a href="https://holybro.com/products/kakute-h7-mini" target="_blank" rel="noreferrer">Holybro</a></li></ul><h2 id="커넥터-및-핀" tabindex="-1">커넥터 및 핀 <a class="header-anchor" href="#커넥터-및-핀" aria-label="Permalink to &quot;커넥터 및 핀&quot;">​</a></h2><img src="'+o+'" width="300px" title="KakuteH7Mini Pinout Image"><table tabindex="0"><thead><tr><th>핀</th><th>기능</th><th>기본값</th></tr></thead><tbody><tr><td>B+</td><td>배터리 양극 전압 (2S-6S)</td><td></td></tr><tr><td>VTX+</td><td>배터리 양극 전압 (2S-6S)</td><td></td></tr><tr><td>SDA, SCL</td><td>I2C 연결(주변장치용)</td><td></td></tr><tr><td>5V</td><td>5V 출력 (최대 2A)</td><td></td></tr><tr><td>3V3</td><td>3.3V output (0.25A max)</td><td></td></tr><tr><td>VI</td><td>FPV 카메라의 비디오 입력</td><td></td></tr><tr><td>VO</td><td>비디오 송신기로 비디오 출력</td><td></td></tr><tr><td>CAM</td><td>To camera OSD control</td><td></td></tr><tr><td>G 또는 GND</td><td>접지</td><td></td></tr><tr><td>RSI</td><td>수신기에서 아날로그 RSSI(0-3.3V) 입력</td><td></td></tr><tr><td>R1, T1</td><td>UART1 RX 및 TX</td><td>TELEM1</td></tr><tr><td>R2, T2</td><td>UART2 RX 및 TX</td><td>TELEM2</td></tr><tr><td>R3, T3</td><td>UART3 RX 및 TX</td><td>NuttX 디버그 콘솔</td></tr><tr><td>R4, T4</td><td>UART4 RX 및 TX</td><td>GPS1</td></tr><tr><td>R6, T6</td><td>UART6 RX and TX (R6 also located in the GH plug)</td><td>RC 포트</td></tr><tr><td>R7</td><td>UART7 RX (RX is located in the plugs for use with 4-in-1 ESCs)</td><td>DShot 텔레메트리</td></tr><tr><td>LED</td><td>WS2182 주소 지정이 가능한 LED 신호 와이어(테스트되지 않음)</td><td></td></tr><tr><td>Z-</td><td>피에조 부저 네거티브 레그(부저 포지티브 레그를 5V 패드에 연결)</td><td></td></tr><tr><td>M1에서 M4</td><td>모터 신호 출력 (4-in-1 ESC에서 사용하기 위해 플러그에 위치)</td><td></td></tr><tr><td>M5 to M8</td><td>모터 신호 출력 (4-in-1 ESC에서 사용하기 위해 플러그에 위치)</td><td></td></tr><tr><td>Boot</td><td>부트로더 버튼</td><td></td></tr></tbody></table><p><a id="bootloader"></a></p><h2 id="부트로더-업데이트" tabindex="-1">부트로더 업데이트 <a class="header-anchor" href="#부트로더-업데이트" aria-label="Permalink to &quot;부트로더 업데이트&quot;">​</a></h2><p>The board comes pre-installed with <a href="https://github.com/betaflight/betaflight/wiki" target="_blank" rel="noreferrer">Betaflight</a>. Before the PX4 firmware can be installed, the <em>PX4 bootloader</em> must be flashed. Download the <a href="https://github.com/PX4/PX4-user_guide/raw/main/assets/flight_controller/kakuteh7mini/holybro_kakuteh7mini_bootloader.hex" target="_blank" rel="noreferrer">holybro_kakuteh7mini_bootloader.hex</a> bootloader binary and read <a href="./../advanced_config/bootloader_update_from_betaflight.html">this page</a> for flashing instructions.</p><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_kakuteh7mini_default</span></span></code></pre></div><h2 id="펌웨어-설치" tabindex="-1">펌웨어 설치 <a class="header-anchor" href="#펌웨어-설치" aria-label="Permalink to &quot;펌웨어 설치&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If you are loading the pre-built firmware via QGroundcontrol, you must use QGC Daily or QGC version newer than 4.1.7. Prior to that release you will need to manually build and install the firmware.</p></div><p>Firmware can be manually installed in any of the normal ways:</p><ul><li><p>Build and upload the source:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_kakuteh7mini_default upload</span></span></code></pre></div></li><li><p><a href="./../config/firmware.html">Load the firmware</a> using <em>QGroundControl</em>. 미리 빌드된 펌웨어나 사용자 지정 펌웨어를 사용할 수 있습니다.</p></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>KakuteH7mini is supported with PX4 main and v1.14 or newer.</p></div><h2 id="px4-설정" tabindex="-1">PX4 설정 <a class="header-anchor" href="#px4-설정" aria-label="Permalink to &quot;PX4 설정&quot;">​</a></h2><p>In addition to the <a href="./../config/">basic configuration</a>, the following parameters are important:</p><table tabindex="0"><thead><tr><th>매개변수</th><th>설정</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#SYS_HAS_MAG">SYS_HAS_MAG</a></td><td>보드에 내부 자력계가 없기 때문에 비활성화하여야 합니다. 외부 자력계를 연결하여 활성화 할 수 있습니다.</td></tr></tbody></table><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>TELEM1</td></tr><tr><td>UART2</td><td>/dev/ttyS1</td><td>TELEM2</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>디버그 콘솔</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>RC SBUS</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>ESC 텔레메트리(DShot)</td></tr></tbody></table><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><h3 id="시스템-콘솔" tabindex="-1">시스템 콘솔 <a class="header-anchor" href="#시스템-콘솔" aria-label="Permalink to &quot;시스템 콘솔&quot;">​</a></h3><p>UART3 RX and TX are configured for use as the <a href="./../debug/system_console.html">System Console</a>.</p><h3 id="swd" tabindex="-1">SWD <a class="header-anchor" href="#swd" aria-label="Permalink to &quot;SWD&quot;">​</a></h3><p>The <a href="./../debug/swd_debug.html">SWD interface</a> (JTAG) pins are:</p><ul><li><code>SWCLK</code>: Test Point 2 (Pin 72 on the CPU)</li><li><code>SWDIO</code>: Test Point 3 (Pin 76 on CPU)</li><li><code>GND</code>: As marked on board</li><li><code>VDD_3V3</code>: As marked on board</li></ul>',37))])}const x=i(c,[["render",m]]);export{y as __pageData,x as default};
